import HeaderCartButton from "./HeaderCartButton/HeaderCartButton";
import classes from "./Header.module.css";


const Header = (props) => {
    return (
      <header className={classes.header}>
          <h1>ReactMeals</h1>
          <HeaderCartButton/>
      </header>
    );
}

export default Header;
